    @staticmethod
    def plot(oFile=None):
        roi = GeoDataFrameDemos6.nizanDistrictInNantesRoi()
        buildings = GeoDataFrameDemos6.nizanDistrictInNantesBuildings()
        roads = GeoDataFrameDemos6.nizanDistrictInNantesRoads()
        sidewalks = GeoDataFrameDemos6.nizanDistrictInNantesSidewalks()
        crosswalks = GeoDataFrameDemos6.nizanDistrictInNantesCrosswalks()
        crosswalk_surf = GeoDataFrameDemos6.nizanDistrictInNantesCrosswalkSurface()
        trees = GeoDataFrameDemos6.nizanDistrictInNantesTrees()
        path1 = GeoDataFrameDemos6.nizanDistrictInNantesPath1()
        path2 = GeoDataFrameDemos6.nizanDistrictInNantesPath2()
        corridor = GeoDataFrameDemos6.nizanDistrictInNantesCorridor()
        waypoints1 = GeoDataFrameDemos6.nizanDistrictInNantesWaypoints1()
        waypoints2 = GeoDataFrameDemos6.nizanDistrictInNantesWaypoints2()
        streetlight = GeoDataFrameDemos6.nizanDistrictInNantesStreetLight()
        streetsanitation = GeoDataFrameDemos6.nizanDistrictInNantesStreetSanitation()

        trees['ID'] = range(len(trees))

        # MAPPING
        minx, miny, maxx, maxy = corridor.buffer(10).total_bounds

        fig, ax = plt.subplots(figsize=(1.2 * 8.26, 1.2 * 8.26))
        roi.boundary.plot(ax=ax, color='blue')
        buildings.plot(ax=ax, color='lightgrey')
        # roads.plot(ax=ax, color='black', linewidth=0.3)
        sidewalks.plot(ax=ax, color='black', linewidth=0.3)
        crosswalks.plot(ax=ax, color='orange', linewidth=0.3)
        crosswalk_surf.plot(ax=ax, color='yellow', alpha=0.3)
        trees.plot(ax=ax, color='green', marker='^', markersize=5)
        path1.plot(ax=ax, color='green', linewidth=0.3)
        waypoints1.plot(ax=ax, color='green', marker='^', markersize=2)
        path2.plot(ax=ax, color='blue', linewidth=0.3)
        waypoints2.plot(ax=ax, color='blue', marker='^', markersize=2)
        corridor.boundary.plot(ax=ax, color='red')
        trees.apply(lambda x: ax.annotate(
            text=x.ID, xy=x.geometry.coords[0],
            color='black', size=7, ha='center'), axis=1)
        streetlight.plot(ax=ax, color='brown', linewidth=0.3)
        # streetsanitation.plot(ax=ax, color='cyan', linewidth=0.3)
        ax.axis('off')
        # ax.axis([minx, maxx, miny, maxy])
        fig.tight_layout()
        if oFile is None:
            plt.show()
        else:
            plt.savefig(oFile, bbox_inches='tight')
        plt.close(fig)

